namespace RonSijm.FluidHumidifier.Factories.MediaPackage;

public class OriginEndpointFactory(string resourceName = null, Action<Humidifier.MediaPackage.OriginEndpoint> factoryAction = null) : ResourceFactory<Humidifier.MediaPackage.OriginEndpoint>(resourceName)
{

    internal InnerOriginEndpointMssPackageFactory MssPackageFactory { get; set; }

    internal InnerOriginEndpointAuthorizationFactory AuthorizationFactory { get; set; }

    internal InnerOriginEndpointCmafPackageFactory CmafPackageFactory { get; set; }

    internal InnerOriginEndpointHlsPackageFactory HlsPackageFactory { get; set; }

    internal InnerOriginEndpointDashPackageFactory DashPackageFactory { get; set; }

    protected override Humidifier.MediaPackage.OriginEndpoint Create()
    {
        var originEndpointResult = CreateOriginEndpoint();
        factoryAction?.Invoke(originEndpointResult);

        return originEndpointResult;
    }

    private Humidifier.MediaPackage.OriginEndpoint CreateOriginEndpoint()
    {
        var originEndpointResult = new Humidifier.MediaPackage.OriginEndpoint
        {
            GivenName = InputResourceName,
        };

        return originEndpointResult;
    }
    public override void CreateChildren(Humidifier.MediaPackage.OriginEndpoint result)
    {
        base.CreateChildren(result);

        result.MssPackage ??= MssPackageFactory?.Build();
        result.Authorization ??= AuthorizationFactory?.Build();
        result.CmafPackage ??= CmafPackageFactory?.Build();
        result.HlsPackage ??= HlsPackageFactory?.Build();
        result.DashPackage ??= DashPackageFactory?.Build();
    }

} // End Of Class

